import React from 'react';

import { auth } from '../services/firebase'
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.min.js';

const Home = ({ user }) => {
  return (
    <div className='container-fluid' color='success'>
      <div className='row mt-2 mb-2' color='success'>
        <div className='col-1'>
        </div>
        <div className='col-8 mb-2'>
          <img src='https://cdn.discordapp.com/attachments/1068101899712208996/1078367572774375545/icon_13.png' style={{ width: "150px", height: "40px" }} />
        </div>
        <div className='col-3'>
          <button class="btn btn-info text-light " style={{ width: "100px", height: "40px" }} onClick={() => auth.signOut()}>Sign out</button>

        </div>
        <hr />
      </div>
      <div className="home">
        <h1>Hello, <span></span>{user.displayName}</h1>
        <h2>{user.email}</h2>
        <img src={user.photoURL} alt="8" />
        <button onClick={() => auth.signOut()}>Sign out</button>
      </div>
    </div>
    // 
  )
}

export default Home;
